let options = {
  fontSize: 14,
  margins: {
    top: 18
  }
};

let survey = new SurveyPDF.SurveyPDF(json, options);
survey.onRenderHeader.add((_, canvas) => {
  canvas.drawImage({
    base64:
      "data:image/png;base64,",
    horizontalAlign: "left",
    width: (canvas.rect.yBot - canvas.rect.yTop) * 0.6,
    height: (canvas.rect.yBot - canvas.rect.yTop) * 0.6,
    margins: {
      left: (canvas.rect.yBot - canvas.rect.yTop) * 0.2
    }
  });
  canvas.drawText({
    text:
      "SurveyJS PDF | Please purchase a SurveyJS PDF developer license to use it in your app | https://surveyjs.io/Buy",
    fontSize: 10
  });
});
survey.onRenderFooter.add((_, canvas) => {
  canvas.drawText({
    text: "Generated via SurveyJS PDF library (BETA)",
    fontSize: 10
  });
  canvas.drawText({
    text: canvas.pageNumber + "/" + canvas.pageCount,
    fontSize: 10,
    horizontalAlign: "right",
    margins: {
      right: 12
    }
  });
});

